import React, { Component } from "react";

// import axios from 'axios'
import axios from "axios";

function getApiData() {
  let x = "789";
  // Make a request for a user with a given ID
  let obj = {
    address: "teynampet",
    patientId: "123",
    phone: "123456789",
    guardianName: "arun",
    doctorId: "456",
    sex: "male",
    name: "arun",
    weight: "47",
    email: "arun123@email.com",
    age: "21",
    height: "170",
  };
  axios
    .post("http://dceed99d2fec.ngrok.io/covid19_patient_monitor/doctor", obj)
    .then(function (response) {
      // handle success
      console.log(response.data);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    });
}

export function Test2() {
  getApiData();
  return <h1>console.log("hello")</h1>;
}
